package Interview.FullForce.DataStructure.codingEverything.LLArrayString.String;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class ValidAnagram {
  public static void main(String[] args) {
//    String s = "anagram", t = "nagaram";
//    System.out.println(isValidAnagram(s, t));
    String s1 = "";
    String t1 = "";
    System.out.println(isValidAnagram(s1, t1));
  }

  private static boolean isValidAnagram(String s, String t) {
    if (s.length() != t.length() || s == null || t == null)
      return false;
    char[] schar = s.toCharArray();
    char[] tchar = t.toCharArray();
    Arrays.sort(schar);
    Arrays.sort(tchar);
    return Arrays.equals(schar, tchar);
  }
}
